import React, { useState, useEffect } from 'react';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import { Table } from "reactstrap";
import { thead, blockUser } from "../../variables/general";

const Users = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [filterDate, setFilterDate] = useState('');
  const [users, setUsers] = useState([]);  // Store the fetched users data
  const [filteredUsers, setFilteredUsers] = useState([]);  // Store filtered user data

  // Fetch user data from API when the component mounts
  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await fetch('/api/admin/users'); // Replace with your API endpoint
        const data = await response.json();
        if (response.ok) {
          setUsers(data);  // Set the users data
          setFilteredUsers(data); // Set initial filtered data to all users
        } else {
          console.error('Failed to fetch users:', data.message);
        }
      } catch (error) {
        console.error('Error fetching users:', error);
      }
    };

    fetchUsers();
  }, []); // Empty dependency array to run the effect only once on component mount

  // Hàm để lọc users dựa trên từ khóa và ngày
  const filterUsers = (term, date) => {
    const filtered = users.filter((user) => {
      const userDate = new Date(user.date);
      const userText = `${user.name} ${user.id} ${user.status}`.toLowerCase();
      return (
        (!date || (!isNaN(userDate) && userDate.toISOString().slice(0, 10) === date)) &&
        userText.includes(term)
      );
    });
    setFilteredUsers(filtered);
  };

  // Hàm xử lý tìm kiếm theo từ khóa
  const handleSearchChange = (e) => {
    const term = e.target.value.toLowerCase();
    setSearchTerm(term);
    filterUsers(term, filterDate);
  };

  // Hàm lọc users theo ngày
  const handleDateChange = (e) => {
    const selectedDate = e.target.value;
    setFilterDate(selectedDate);
    filterUsers(searchTerm, selectedDate);
  };

  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-md-3 p-0">
          <Sidebar />
        </div>
        <div className="col-md-9" style={{ marginLeft: '250px', width: '81.5%' }}>
          <Header title="Quản lý User" />
          <div className="container-fluid">
            <h4 style={{ margin: '10px' }}>Users Table</h4>

            {/* Trường nhập liệu tìm kiếm từ khóa */}
            <input
              type="text"
              placeholder="Tìm kiếm người dùng"
              value={searchTerm}
              onChange={handleSearchChange}
              className="form-control mb-3"
            />

            {/* Bộ lọc theo ngày */}
            <input
              type="date"
              value={filterDate}
              onChange={handleDateChange}
              className="form-control mb-3"
            />

            {/* Bảng users đã lọc */}
            <Table responsive>
              <thead className="text-primary">
                <tr>
                  {thead.map((prop, key) => (
                    <th key={key} className="text-center">{prop}</th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {filteredUsers.map((user, key) => (
                  <tr key={key}>
                    {user.data.map((field, key) => (
                      <td key={key} className="text-center">{field}</td>
                    ))}
                  </tr>
                ))}
              </tbody>
            </Table>

            {/* Bảng Blocked Users */}
            <h4 style={{ margin: '10px' }}>Blocked Users Table</h4>
            <Table responsive>
              <thead className="text-primary">
                <tr>
                  {blockUser.map((prop, key) => (
                    <th key={key} className="text-center">{prop}</th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {filteredUsers.map((user, key) => (
                  <tr key={key}>
                    {user.data.map((field, key) => (
                      <td key={key} className="text-center">{field}</td>
                    ))}
                    <td>
                      {/* You can add Unblock button here */}
                    </td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Users;
